import React from 'react';
import {  Link } from "react-router-dom";

const navbar= () =>{
  return (
  <div>
    <li>
      <Link to="/">Dogs</Link>
    </li>
    <li>
      <Link to="/Quiz">Quiz</Link>
    </li>
    <li>
      <Link to="/Crushes">Crushes</Link>
    </li>
  </div>
  );
}
export default navbar;
